import React from "react";
import { Grid } from "@material-ui/core";
import PokeCard from "./PokeCard";

function PokeDescription({ pokeImage }) {
  return (
    <Grid>
      <PokeCard image={pokeImage} />
    </Grid>
  );
}

export default PokeDescription;
